import "../App.css";
import React from 'react';

const SearchBar = (props) => {
    return (
        <>
            <input handleChange={() => navigator.clipboard.writeText(props.symbol)} placeholder="Search" className="Search input" ></input>
            <div>{props.symbol}</div>
        </>
    );
  };


export default SearchBar;
